import React from "react";
import "./StartProject.css";
import rectangel from "../../../logos/Rectangle 3.png";

const StartProject = () => {
  return (
    <div className='section'>
      <div className='section_wrapper'>
        <div>
          <h2 className='section_title'>Start your project with Brandit</h2>
          <p className='info_text'>Send us a message today to get started.</p>
        </div>
        <img src={rectangel} alt='' />
      </div>
    </div>
  );
};

export default StartProject;
